import React, {Component} from 'react';

export default class Item extends Component {
	render(){
		const {purchaseItem, item, i} = this.props;
		return (
		<div className="col-xs-6 col-sm-3">
				{item.itemCount ? 
					<div className="items-left bg-success text-success"><span>Available items: {item.itemCount}</span></div> : 
					<div className="items-left bg-danger text-danger"><span>Out of stock</span></div>
				}
	      <img className="img-responsive center-block img-max-150" src={item.imgUrl} alt=".." />
	      <div className="item bg-warning text-warning"><span>{item.itemName}</span></div>
	      <div className="item-price bg-info text-info"><span>Precio: {item.itemPrice}â‚¬</span></div>
	      <a onClick={purchaseItem} data-value={i} className="btn-purchase" href="#"></a>
	    </div>
		)
	}
}

